Installation Pour installer le SDK Typescript, il faut executer : npm install --save @marigold-dev/gas-station-lib Explanations Le SDK est compos√© de deux classes : GasStation et PermitContract. La classe GasStation permet de communiquer facilement avec l'API de la Gas Station, sans avoir √† initiliaser soit-m√™me la requete HTTP. Pour initialiser cette classe, il faut lui donner une URL d'API de Gas Station. Pour le moment, vous pouvez donner https://gas-station-api.marigold.dev/operation. La classe poss√®de deux m√©thodes : postOperation prend en param√®tre un sender (g√©n√©ralement l'adresse de l'utilisateur) et une operation de type export type Operation = { destination: string; parameters: unknown;
}; Cette m√©thode va ensuite pr√©parer la requ√™te HTTP et l'envoyer sur le endpoint /operation de l'API, qui traiter l'operation. postOperations prend √©galement un sender et un tableau d' Operation et permet d'envoyer plusieurs op√©rations √† la fois. La classe PermitContract permet de g√©n√©rer un permit TZIP-17 pour un contrat donn√©. Un permis est une autorisation √† appeler un endpoint sp√©cifique d'un smart contrat avec un param√®tre sp√©cifi√© pour le compte d'une adresse donn√©e. Cette autorisation peut √©ventuellement expirer. Il est notamment utile pour la manipulation de tokens FA lorsque c'est l'utilisateur qui a le ownership (transfer, update_operation, approve) Cette classe a deux m√©thodes : generatePermit permet de cr√©er un permis √† partir d'une operation de transfert. Elle retourne un objet contenant { bytes: string, // les bytes contenant le permis transfer_hash: string, // le hash de l'operation de transfet
} Suite √† l'appel de generatePermit, vous devrez faire signer les bytes par le owner du token pour finaliser le permis. permitCall permet d'appeler l'entrypoint permit sur le contrat cible. Cela va permettre d'enregister le permis dans le storage du contrat (cf TZIP-17). Cette m√©thode prend en param√®tre un objet de type type PermitOperation = { publicKey: string; signature: string; transferHash: string;
}; et retourne une op√©ration de type TransferParams. Usage Pour commencer, il faut importer et initialiser l'objet GasStation du SDK : import { GasStation } from '@marigold-dev/gas-station-lib' const gasApi = new GasStation({ apiURL: 'https://gas-station-api.marigold.dev/'
}) Vous pouvez ensuite forger votre operation, par exemple mint un NFT (ici le contrat poss√®de un entrypoint mint_token): const mintOperation = await contract.methodsObject.mint_token([{ owner: userAddress, token_id: tokenId, amount_: 1 }]).toTransferParams() Et enfin, vous pouvez envoyer votre operation √† la Gas Station avec : const response = await gasApi.postOperation(userAddress, { destination: mintOperation.to, parameters: mintOperation.parameter });

