Pour le staking, nous avons besoin d'un permis. En effet, le staking consiste √† transf√©rer notre NFT fra√Æchement mint√© vers le contrat. Comme le NFT nous appartient, il convient de signer un permis (une autorisation) pour pouvoir effectuer ce transfert. Pour faciliter le d√©veloppement de cette nouvelle feature, nous allons √©galement utiliser le SDK Typescript (pour rappel, vous avez toutes les informations ici ) Pour commencer, nous allons initialiser les classes GasStation et PermitContract du SDK : const gasStationApi = new GasStation({ apiURL: PUBLIC_GAS_STATION_API });
const permitContract = new PermitContract(PUBLIC_PERMIT, Tezos); Maintenant nous pouvons g√©n√©rer notre permis √† l'aide de la m√©thode generatePermit : const permit_data = await permit_contract.generatePermit({ from_: user_address, txs: [{ to_: PUBLIC_STAKING_CONTRACT, token_id, amount: 1 }] }); Quelques explications : La variable PUBLIC_STAKING_CONTRACT contient l'adresse du contrat de staking (disponible √† cette adresse KT1MLMXwFEMcfByGbGcQ9ow3nsrQCkLbcRAu sur Ghostnet) Le token_id correspond √† l'ID du token que vous voulez stake permit_data contient alors le hash du permis bytes et le hash de l'op√©ration de transfert transfer_hash { bytes: string; transfer_hash: string;
} On doit ensuite faire signer ce permis par l'utilisateur propri√©taire du token et r√©cup√©rer cette signature. Cela se fait facilement √† l'aide de Taquito : const signature = (await (await wallet.client).requestSignPayload({ signingType: SigningType.MICHELINE, payload: permit_data.bytes })).signature; Une fois que nous avons le permis sign√©, nous pouvons l'enregistrer aupr√®s du contrat qui impl√©mente l'entrypoint permit. On va encore pouvoir utiliser le SDK pour faire cela : const permit_op = await permit_contract.permitCall({ publicKey: activeAccount.publicKey, signature: signature, transferHash: permit_data.transfer_hash }); publicKey est la cl√© publique du propri√©taire du token signature est la signature du permis r√©cup√©r√©e √† l'√©tape pr√©c√©dente transferHash est le hash de l'op√©ration de transfert renvoy√© lors de la cr√©ation du permis A ce stade, nous avons toutes les informations n√©cessaires concernant le permis. Nous allons maintenant pouvoir forg√© l'op√©ration de staking √† proprement parler et envoyer le tout √† la Gas Station. Pour forger l'op√©ration de staking, on fait comme d'habitude, on r√©cup√®re l'instance du contrat √† l'aide de Taquito et l'on craft l'op√©ration pour r√©cup√©rer les param√®tres. const staking_contract = await Tezos.wallet.at(PUBLIC_STAKING_CONTRACT);
const staking_op = await staking_contract.methods.stake( 1, user_address ).toTransferParams(); :info: PUBLIC_STAKING_CONTRACT est une variable d'environnement contenant l'adresse du contrat impl√©mentant l'entrypoint de staking Il ne nous reste plus qu'√† envoyer l'op√©ration √† la Gas Station afin que les frais de gas soient pay√©s : const response = await gas_api.postOperations(user_address, [ { destination: permit_op.to, parameters: permit_op.parameter }, { destination: staking_op.to, parameters: staking_op.parameter } ]); Ici on utilise postOperations pour poster un batch d'op√©rations. Ce batch contient l'op√©ration pour enregistrer le permis et l'op√©ration de staking. Lorsque l'on appelera l'entrypoint stake du contrat de staking, le permis sera rev√©l√© et consomm√©. Comme pour l'op√©ration de mint, la Gas Station r√©pondra en qq dizaines de secondes.
